Ce tableau de bord est proposé par l'Abes. Il s'adresse aux établissements habilités à délivrer le doctorat et leur permet d'accéder aux statistiques de consultation des thèses de leur établissement, de les filtrer et de les comparer avec celles des autres établissements ou avec les statistiques nationales.

**ATTENTION** : le présent tableau de bord ne permet pas de visualiser l'état de la base de données de theses.fr, mais seulement les données relatives aux pages de thèses qui ont été consultées ou aux fichiers de thèses qui ont été téléchargés.

Les statistiques sont disponibles pour les données suivantes :
  - nombre de notices de thèses vues ;
  - nombre de thèses téléchargées en accès libre ;
  - nombre de thèses téléchargées sur l'intranet national ;
  - nombre de pages de personnes vues ;
  - nombre de pages d'organismes vues.

Les pages de theses.fr peuvent être consultées :
- par des humains via l'interface de theses.fr (HTML) ;
- par des machines via une API (Json).

**ATTENTION** : les statistiques sont complètes avec un **décalage de 10 jours** (ainsi les statistiques d'un jour n sont complètes à n+10).

